		function getNombreSplit(nombreCompleto)
		{
			var chunks = nombreCompleto.toUpperCase().split(" ").reverse();
			var exceptions = ["DE", "LA", "DEL", "LOS", "SAN", "SANTA"];
			var nombre = {
				nombre: '',
				aPaterno: '',
				aMaterno: ''
			};
			var agregarEn = 'materno';
			var primeraVez = true;

			for( var i = 0; i < chunks.length; i++ )
			{
				chunk = chunks[i];
				if (primeraVez) 
				{
					nombre.aMaterno = chunk + ' ' + nombre.aMaterno;
					primeraVez = false;
				}
				else
				{
					if( exceptions.indexOf( chunk ) != -1 )
					{
						if ( agregarEn == 'materno' )
						{
							nombre.aMaterno = chunk.charAt(0) + chunk.slice(1).toLowerCase() + ' ' + nombre.aMaterno;
						}
						else if ( agregarEn == 'paterno' )
						{
							nombre.aPaterno = chunk.charAt(0) + chunk.slice(1).toLowerCase() + ' ' + nombre.aPaterno;
						}
						else
						{
							nombre.nombre = chunk.charAt(0) + chunk.slice(1).toLowerCase() + ' ' + nombre.nombre;
						}
					}
					else
					{
						if ( agregarEn == 'materno' )
						{
							agregarEn = 'paterno';
							nombre.aPaterno = chunk.charAt(0) + chunk.slice(1).toLowerCase() + ' ' + nombre.aPaterno;
						}
						else if ( agregarEn == 'paterno' )
						{
							agregarEn = 'nombre';
							nombre.nombre = chunk.charAt(0) + chunk.slice(1).toLowerCase() + ' ' + nombre.nombre;
						}
						else
						{
							nombre.nombre = chunk.charAt(0) + chunk.slice(1).toLowerCase() + ' ' + nombre.nombre;
						}
					}
				}
			}
		}

